import React from "react";
import EmployeeList from "./component/employeeList/EmployeeList";
import { employee } from "./data/data";
function App() {
  return (
    <div>
      <h1> Employees ({employee.length})</h1>
      <EmployeeList employee={employee} />
    </div>
  );
}

export default App;
